import React from "react";
import {Link, Outlet} from "react-router-dom";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome , faShop } from '@fortawesome/free-solid-svg-icons';
import './Navbar.css'

const  Navbar = () =>{
    return(
        <div>
            <ui className="navbar">

                <li><Link className="LINK" to="/"> <FontAwesomeIcon icon={faHome} size="6px"/> Home page </Link></li>
                <li><Link className="LINK" to="shop"><FontAwesomeIcon icon={faShop} size="6px"/> Shop </Link></li>
                <li><Link className="LINK" to="contactus"> Contact us </Link></li>
                <li><Link className="LINK" to="aboutus"> About us </Link></li>

            </ui>
            <Outlet/>
        </div>
    );
}

export default Navbar
